import axios from "axios";
import React, { useEffect, useState } from "react";

import NewMusic from "./components/NewMusic";

function App() {
  const [musics, setMusics] = useState([]);
  useEffect(() => {
    axios.get("localhost:5000").then((res) => setMusics(res.data));
  }, []);
  return (
    <div>
      <NewMusic />
    </div>
  );
}

export default App;
